import React from 'react'

const Header = () => {
  const logo = 'https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png';  
  return (
    <div className='header'>
        <></>
        <img src={logo} alt="demo"/>
    </div>
  )
}

export default Header
